import './flashcards.css';
import React from 'react';
import ReactDOM from 'react-dom';




export class FlashCardsOne extends React.Component{
  state = {
    "front":true,
    "current":0,
    "cards":[["How can you include an external javascript file?","/script src='myfile.js'/"], ["Can a variable name can begin with number.","False, a variable name can NOT begin with a number."], ["The following function of String object is used to match a regular expression against a string.","match()"], ["true/false: NaN == NaN","false."], ["How can you determine if something is NaN?.","use isNaN() function."]]
  }
  back = (e) => {

    if (this.state.current > 0){
      this.state.front = true
      this.setState({
        "current" : this.state.current - 1
      })

    }
  }
  flip = (e) => {
    if (this.state.front){
      this.setState({
        "front":false
      })

    }
    else{
      this.setState({
        "front":true
      })

    }
  }
  next = (e) => {

    if (this.state.current < 4){
      this.state.front = true
      this.setState({
        "current": this.state.current + 1,
      })

    }
  }

  render(){
    if (this.state.front){
      // let current = parseInt(this.state.current)
      return(  
      <div className="flashbutton-container">
        <div className="flashcard" style={{backgroundColor: "purple", color:"yellow", border:"3px solid yellow"}}>
          {this.state.cards[this.state.current][0]}
        </div>
       <center><div className="buttons">
          <button className="btn1" onClick={() => {
            this.back()
          }}>Back</button>       
          <button className="btn1" onClick={() => {
            this.flip()
          }}>Flip</button>    
          <button className="btn1" onClick={()=>{
            this.next()
          }}>Next</button>
        </div></center> 

      </div>
    )}
    else{
      // let current = parseInt(this.state.current)
      return(  
      <div className="flashbutton-container">
        <div className="flashcard" style={{backgroundColor: "yellow", color:"purple", border:"3px solid yellow"}}>
          {this.state.cards[this.state.current][1]}
        </div>
        <center><div className="buttons">
          <button className="btn1" onClick={() => {
            this.back()
          }}>Back</button>       
          <button className="btn1" onClick={() => {
            this.flip()
          }}>Flip</button>    
          <button className="btn1" onClick={()=>{
            this.next()
          }}>Next</button>
          <br />
          <br />
          <br />
          <br />
          <br />
          <br />
          <br />
          <br />
          <br />
          <br />
          <br /><footer>© 2021 JD Schools</footer>
        </div></center> 

      </div>
    )
      }

    }

  }


